import { useNavigate } from "react-router-dom";

function Menu() {
	const navigate = useNavigate();

	return (
		<div className="menu">
			<ul>
				<li>
					<button onClick={() => navigate("/login")}>Login </button>
				</li>
				<li>
					<button onClick={() => navigate("/inscription")}>Sign up </button>
				</li>
			</ul>
		</div>
	);
}

export default Menu;
